    @Test
    public void testGetMembers() throws Throwable {

        try {

            String param = "{ \"queryType\" : \"metadata\","
                           + "\"data\" : { \"root\" : [\"Traffic\", \"[Traffic]\", \"[Zone]\", \"[Zone.Name]\", \"[Zone.Name].[Name0]\"], \"withProperties\" : false, \"granularity\" : 1}}";

            JSONObject query = new JSONObject(param);
            JSONObject data = query.getJSONObject("data");
            JSONArray root = data.getJSONArray("root");

            JSONObject result = new JSONObject();
            result = (JSONObject) (getMembers.invoke(metadata, root, false, 1));

            assertTrue("the result does not contain the first member", result.has("[Zone.Name].[All Zone.Names].[Croatia]"));
            assertTrue("the result does not contain the last member", result.has("[Zone.Name].[All Zone.Names].[Spain]"));

            result = (JSONObject) (getMembers.invoke(metadata, root, true, 1));
           assertTrue("the result does not contain the first member's properties",
                       result.getJSONObject("[Zone.Name].[All Zone.Names].[Croatia]")
                             .has("Geometry"));
            assertTrue(" the result does not contain the last member's properties  ",
                       result.getJSONObject("[Zone.Name].[All Zone.Names].[Spain]")
                             .has("Geometry"));

            param = "{ \"queryType\" : \"metadata\","
                    + "\"data\" : { \"root\" : [\"Traffic\", \"[Traffic]\", \"[Zone]\", \"[Zone.Name]\", \"[Zone.Name].[Name0]\", [\"[Zone.Name].[All Zone.Names].[France]\" , \"[Zone.Name].[All Zone.Names].[Spain]\" ] ], \"withProperties\":false, \"granularity\":0}}";
        	
            root = new JSONObject(param).getJSONObject("data").getJSONArray("root");

            result = (JSONObject) (getMembers.invoke(metadata, root, false, 0));
            assertTrue("the result contains only the members France and Spain",
                       !result.has("[Zone.Name].[All Zone.Names].[Germany]") && result.has("[Zone.Name].[All Zone.Names].[France]") && result.has("[Zone.Name].[All Zone.Names].[Spain]"));
           
            param = "{ \"queryType\" : \"metadata\","
                    + "\"data\" : { \"root\" : [\"Traffic\", \"[Traffic]\", \"[Zone]\", \"[Zone.Name]\", \"[Zone.Name].[Name0]\", \"[Zone.Name].[All Zone.Names].[France]\" ], \"withProperties\":false, \"granularity\":2}}";
        	
            root = new JSONObject(param).getJSONObject("data").getJSONArray("root");

            
            result = (JSONObject) (getMembers.invoke(metadata, root, false, 2));
            assertTrue("the result does not only contains the children of France with a granularity 2",
                       result.has("[Zone.Name].[All Zone.Names].[France].[DPARTEMENTS D'OUTRE-MER].[Guyane]")
                               && !result.has("[Zone.Name].[All Zone.Names].[France]"));

            param = "{ \"queryType\" : \"metadata\","
                    + "\"data\" : { \"root\" : [\"Traffic\", \"[Traffic]\", \"[Measures]\", \"[Measures]\", \"[Measures].[MeasuresLevel]\"], \"withProperties\" : true}}";

            result = (JSONObject) (getMembers.invoke(metadata, new JSONObject(param).getJSONObject("data").getJSONArray("root"), true, 0));

            assertTrue(" the result does not contain the members corresponding to the different measures ",
                       result.has("[Measures].[Goods Quantity]") && result.has("[Measures].[Max Quantity]"));

            
        } catch (IllegalAccessException e) {
            e.printStackTrace();
        } catch (IllegalArgumentException e) {
            e.printStackTrace();
        } catch (InvocationTargetException e) {
            e.printStackTrace();
        }

    }

